শকুন্তলা ! যোৱা ১৭ মে’ৰ ২০২১ ৰ পৰা Rang Channel ত সম্প্ৰচাৰিত হোৱা 'শকুন্তলা' ধাৰাবাহিকখন কালি ১০১ টা খণ্ড সম্পূৰ্ণ কৰি আহি শেষ খণ্ডলৈ ঢাপলি মেলিছে।প্ৰথমতে মোৰ ১৭ মে’ৰ দিনটো কেতিয়াকৈ আহিব কেতিয়াকৈ আহিব লাগিছিল আৰু আজি মোৰ খুউব দুখ লাগিছে যে 'শকুন্তলা' ধাৰাবাহিকখন আজি অন্ত পৰিব।যিহওক, শ্ৰদ্ধাৰ জ্ঞান বৰুৱাৰ কাহিনীৰে ৰচিত 'শকুন্তলা' ধাৰাবাহিকখনত মোৰ এটা খুউব ভাল লগা চৰিত্ৰ আছিল। এই ধাৰাবাহিকখনত মোক যে এটি প্ৰধান চৰিত্ৰত অভিনয় কৰিবলৈ সুযোগ প্ৰদান কৰিলে,তাৰবাবে মই পৰিচালক সুনয়না ফুকন মহন্ত বাইদেউকে @sunoyana ধৰি পৰিকল্পনা ৰিনিকি ভূঞা শৰ্মা বাইদেউ, ব্যৱস্থাপনা শ্ৰদ্ধাৰ কৃষ্ণা বৰুৱা,চিত্ৰনাট্য সংলাপ শ্ৰদ্ধাৰ শিল্পীকা মধুকলাকে ধৰি শকুন্তলা পৰিয়ালৰ সমূহ কলা কুশলীক আন্তৰিক শ্ৰদ্ধা আৰু কৃতজ্ঞতা জ্ঞাপন কৰিছো। লগতে ভৱিষ্যতেও যাতে মোক পুনৰ এনে কামৰ সুযোগ প্ৰদান কৰে তাৰবাবে আশাৰে বাট চাই ৰম।
বিশেষকৈ শকুন্তলা ধাৰাবাহিকখন মোৰ জীৱনৰ প্ৰথমখন ধাৰাবাহিক।মই নাজানো দৰ্শকক মই আকৰ্ষিত কৰিব পাৰিলোনে নাই।কিন্ত মই মোৰ ফালৰ পৰা যিমানখিনি পাৰো সিমানখিনি দিবলৈ চেষ্টা কৰিছিলো। ইয়াৰ ফলাফল আপোনালোকে মোক মেছেজতে জনাব বুলি আশা কৰিলোঁ। কাৰণ মোৰ ভুল ক্ৰুটিবোৰ আপোনালোকে আঙুলিয়াই দিলেহে ভৱিষ্যতে মই নিজক শুদ্ধ পথেৰে আগুৱাই নিব পাৰিম।আপোনালোকৰ সহাৰিয়েই হ'ব মোৰ বাবে আশীৰ্বাদ। 
শেষত প্ৰথমৰ পৰা শেষলৈকে শকুন্তলা পৰিয়ালক যি মৰম আৰু সঁহাৰি দিলে তাৰবাবে আমি আপোনালোকৰ ওচৰত নথৈ আনন্দিত আৰু চিৰকৃতজ্ঞ। ভৱিষ্যতেও এনেদৰেই আমাক মৰম আৰু সঁহাৰি দিব বুলি আশাৰে বাট চাই ৰম।
